import React, {Component} from 'react'
import {connect} from "react-redux";

import {login, logout} from "../../store/actions/AuthActions";
import Header from "../_layouts/_includes/header/Header";
import Drawer from "../_layouts/_includes/drawer/Drawer";
import Content from "../_layouts/_includes/content/Content";
import Footer from "../_layouts/_includes/footer/Footer";

class CompositionsPage extends Component {
    render() {
        const {userActions, userInfo} = this.props

        return (
            <>
                <Header/>
                <Drawer/>
                <Content>
                    <h1>Compositions</h1>
                    <Footer/>
                </Content>
            </>
        )
    }
}

const mapStateToProps = (store) => {
    return {
        userInfo: store.user
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        userActions: {
            login: () => dispatch(login()),
            logout: () => dispatch(logout()),
        }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(CompositionsPage)
